import { Box } from "native-base";
const ListOfPokemon = () => {
  return (
    <Box
      p="2"
      bg="primary.500"
      _text={{
        fontSize: "md",
        fontWeight: "medium",
        color: "warmGray.50",
        letterSpacing: "lg",
      }}
      shadow={2}
    >
      This is a Box
    </Box>
  );
};

export default ListOfPokemon;
